$(function(){
	
	if($( ".calendar" ).length > 0){
	$.datepicker.regional["ko"] = {
		closeText: "닫기",
		prevText: "이전달",
		nextText: "다음달",
		currentText: "오늘",
		yearRange: 'c-70:c+00',
		monthNames: ["1월","2월","3월","4월","5월","6월", "7월","8월","9월","10월","11월","12월"],
		monthNamesShort: ["1월","2월","3월","4월","5월","6월", "7월","8월","9월","10월","11월","12월"],
		dayNames: ["일","월","화","수","목","금","토"],
		dayNamesShort: ["일","월","화","수","목","금","토"],
		dayNamesMin: ["일","월","화","수","목","금","토"],
		weekHeader: "Wk",
		dateFormat: "yy-mm-dd",
		firstDay: 0,
		isRTL: false,
		showMonthAfterYear: true,
		yearSuffix: ""
	};
	$.datepicker.setDefaults($.datepicker.regional["ko"]);
	
		$( ".calendar-single" ).datepicker();	
		$( ".calender-multi" ).datepicker({
			numberOfMonths: 2
		});	
		
	}

	// 윈도우 사이즈(모바일 컨트롤)
	var windowSize = $(window).width();
	function fNwindowSize(){
		windowSize = $(window).width();
	}
	
	$(window).resize(function(){
		fNwindowSize();
	})
	fNwindowSize();
	
	if(windowSize < 1023){
		// 모바일 화면일떄
		$('.subscription-schedule .box.box2 .date-box .btn-type1, .subscription-schedule .box.box2 .btn-close, .subscription-schedule .bg-box2').click(function(){
			$('.subscription-schedule .box.box2').fadeOut(300);
			$('.subscription-schedule .bg-box2').fadeOut(300);
		});

		$('.subscription-schedule .box .date-box .btn-cal').click(function(){
			$('.subscription-schedule .box.box2').fadeIn(300);
			$('.subscription-schedule .bg-box2').fadeIn(300);
		});
	}else{
		// PC 화면일떄
		$('.subscription-schedule .box .date-box .btn-cal').click(function(){
			$('.subscription-schedule .box1').hide();
			$('.subscription-schedule .box2').stop().fadeIn(300);
		});
		$('.subscription-schedule .box .date-box .btn-type1').click(function(){
			$('.subscription-schedule .box1').stop().fadeIn(300);
			$('.subscription-schedule .box2').hide();
		});

	}
	
	// 마이페이지 >  결제정보변경 신용카드 클릭시 카드정보 입력 노출
	$('.payment-kind .list .btn-card').click(function(){
		$(this).addClass('active');
		$('.payment-kind .card-inputs').stop().slideDown(300);
	}); 
	
	// 별점 선택 이벤트
	$('.grade.event i').click(function(){
		$(this).parent().children('i').removeClass('on');
		$(this).addClass('on').prevAll('i').addClass('on');
	})

	// 장바구니 주문완료 펼침(모바일)
	$('.order-end-flip a').click(function(){
		$(this).toggleClass('active');
		$('.cart-list').stop().slideToggle(300);
	})
	
	// 모바일 Footer 사업자정보 펼침
	$('#footer .foot2 .info button').click(function(){
		$(this).toggleClass('active');
		$(this).next('div').stop().slideToggle(300);
	})
	
	$('#header .btn-m').click(function(){
		$('body').addClass('on-gnb');
		return false;
	})	
	$('.m-gnb  .btn-close').click(function(){
		$('body').removeClass('on-gnb');
		return false;
	})
	
	$('.m-gnb  nav .btn-dep1.flip').click(function(){
		if($(this).parent().hasClass('active')){
			$(this).parent().removeClass('active');
			$(this).next('.dep2').stop().slideUp(300);
		}else{
			$(this).next('.dep2').slideDown(300).parent().siblings().find('.dep2').slideUp(300);
			$(this).parent().addClass('active').siblings().removeClass('active');	
		}
		return false;
	})


	
	
	
	
	

});
